import React, { Component } from "react";
import { BrowserRouter as Router, Link } from "react-router-dom";
import "../css/header.css";

export class Header extends Component {
  render() {
    return (
      <div className="header">
        <a to="..">
          <img
            src="https://geeksjapan.asia/assets/img/logo.png"
            alt="Logo"
            width="120px"
          />
        </a>
        <Router>
          <Link to="/category/life" color="secondary">
            Life
          </Link>
          <Link to="/category/explore" color="secondary">
            Explore
          </Link>
          <Link to="/category/work" color="secondary">
            Work
          </Link>
          <Link to="/category/culture" color="secondary">
            Culture
          </Link>
          <Link to="/category/learn" color="secondary">
            Learn
          </Link>
        </Router>
      </div>
    );
  }
}

export default Header;
